/**
 * Result for a single data source
 */
public struct SourceResult {
    public var sourceType: DataSourceType
    public var sourceName: String
    public var recordsAdded: UInt64
    public var recordsSkipped: UInt64
    public var success: Bool
    public var errorMessage: String?

    // Default memberwise initializers are never public by default, so we
    // declare one manually.
    public init(sourceType: DataSourceType, sourceName: String, recordsAdded: UInt64, recordsSkipped: UInt64, success: Bool, errorMessage: String?) {
        self.sourceType = sourceType
        self.sourceName = sourceName
        self.recordsAdded = recordsAdded
        self.recordsSkipped = recordsSkipped
        self.success = success
        self.errorMessage = errorMessage
    }
}



extension SourceResult: Equatable, Hashable {
    public static func ==(lhs: SourceResult, rhs: SourceResult) -> Bool {
        if lhs.sourceType != rhs.sourceType {
            return false
        }
        if lhs.sourceName != rhs.sourceName {
            return false
        }
        if lhs.recordsAdded != rhs.recordsAdded {
            return false
        }
        if lhs.recordsSkipped != rhs.recordsSkipped {
            return false
        }
        if lhs.success != rhs.success {
            return false
        }
        if lhs.errorMessage != rhs.errorMessage {
            return false
        }
        return true
    }

    public func hash(into hasher: inout Hasher) {
        hasher.combine(sourceType)
        hasher.combine(sourceName)
        hasher.combine(recordsAdded)
        hasher.combine(recordsSkipped)
        hasher.combine(success)
        hasher.combine(errorMessage)
    }
}


