/**
 * Error types for uniffi
 */
public enum ExtractionError {

    
    
    case DatabaseError(msg: String
    )
    case SourceNotFound(msg: String
    )
    case PermissionDenied(msg: String
    )
    case InvalidPath(msg: String
    )
    case ExtractionFailed(msg: String
    )
    case Other(msg: String
    )
}


public struct FfiConverterTypeExtractionError: FfiConverterRustBuffer {
    typealias SwiftType = ExtractionError

    public static func read(from buf: inout (data: Data, offset: Data.Index)) throws -> ExtractionError {
        let variant: Int32 = try readInt(&buf)
        switch variant {

        

        
        case 1: return .DatabaseError(
            msg: try FfiConverterString.read(from: &buf)
            )
        case 2: return .SourceNotFound(
            msg: try FfiConverterString.read(from: &buf)
            )
        case 3: return .PermissionDenied(
            msg: try FfiConverterString.read(from: &buf)
            )
        case 4: return .InvalidPath(
            msg: try FfiConverterString.read(from: &buf)
            )
        case 5: return .ExtractionFailed(
            msg: try FfiConverterString.read(from: &buf)
            )
        case 6: return .Other(
            msg: try FfiConverterString.read(from: &buf)
            )

         default: throw UniffiInternalError.unexpectedEnumCase
        }
    }

    public static func write(_ value: ExtractionError, into buf: inout [UInt8]) {
        switch value {

        

        
        
        case let .DatabaseError(msg):
            writeInt(&buf, Int32(1))
            FfiConverterString.write(msg, into: &buf)
            
        
        case let .SourceNotFound(msg):
            writeInt(&buf, Int32(2))
            FfiConverterString.write(msg, into: &buf)
            
        
        case let .PermissionDenied(msg):
            writeInt(&buf, Int32(3))
            FfiConverterString.write(msg, into: &buf)
            
        
        case let .InvalidPath(msg):
            writeInt(&buf, Int32(4))
            FfiConverterString.write(msg, into: &buf)
            
        
        case let .ExtractionFailed(msg):
            writeInt(&buf, Int32(5))
            FfiConverterString.write(msg, into: &buf)
            
        
        case let .Other(msg):
            writeInt(&buf, Int32(6))
            FfiConverterString.write(msg, into: &buf)
            
        }
    }
}


